<?php

namespace Appleton\Taxes\Seeds\US\Alabama;

use Appleton\Taxes\Countries\US\Alabama\GadsdenOccupational;
use DB;
use Illuminate\Database\Seeder;

class GadsdenSeeder extends Seeder
{
    public function run()
    {
        if (DB::table(config('taxes.governmental_unit_areas'))->where('name', 'Gadsden, AL')->exists()) return;

        $id = DB::table(config('taxes.governmental_unit_areas'))->insertGetId([
            'name' => 'Gadsden, AL',
            'area' => '',
        ]);

        DB::table(config('taxes.tax_areas'))->insert([
            'name' => 'Gadsden Occupational Tax',
            'tax' => GadsdenOccupational::class,
            'governmental_unit_area_id' => $id,
        ]);
    }
}
